import React, { useState, useEffect, useCallback } from 'react';
import { useParams } from 'react-router-dom';
import { getPatientVitals } from '../services/ThingSpeakService';
import './PatientDetail.css';

const PatientDetail = () => {
  const { id } = useParams();
  const [patientData, setPatientData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const fetchVitals = useCallback(async () => {
    if (!id) return;

    try {
      const vitalsData = await getPatientVitals(id);
      setPatientData(prev => ({
        ...prev,
        ...vitalsData
      }));
      setLoading(false);
    } catch (error) {
      console.error('Error fetching vitals:', error);
      setError(error.message);
      setLoading(false);
    }
  }, [id]);

  useEffect(() => {
    fetchVitals();

    // Set up polling interval
    const interval = setInterval(fetchVitals, 30000); // Poll every 30 seconds

    return () => clearInterval(interval);
  }, [fetchVitals]);

  if (loading) {
    return <div className="loading">Loading patient data...</div>;
  }

  if (error) {
    return (
      <div className="error">
        <h3>Error loading patient data</h3>
        <p>{error}</p>
      </div>
    );
  }

  if (!patientData) {
    return <div className="error">No patient data available</div>;
  }

  return (
    <div className="patient-detail">
      <div className="vital-signs">
        <h2>Vital Signs</h2>
        <div className="vitals-grid">
          <div className="vital-card">
            <h3>Blood Pressure</h3>
            <p className={`value ${patientData.vitals.bloodPressure.systolic > 140 ? 'alert' : ''}`}>
              {patientData.vitals.bloodPressure.display} mmHg
            </p>
          </div>

          <div className="vital-card">
            <h3>Temperature</h3>
            <p className={`value ${patientData.status.ecg.toLowerCase()}`}>
              {patientData.vitals.pulse} °C
            </p>
          </div>

          <div className="vital-card">
            <h3>Humidity</h3>
            <p className={`value ${patientData.status.temperature.toLowerCase()}`}>
              {patientData.vitals.temperature}
            </p>
          </div>

          <div className="vital-card">
            <h3>Heart Rate</h3>
            <p className={`value ${patientData.status.spo2.toLowerCase()}`}>
              {patientData.vitals.spo2} BPM
            </p>
          </div>

          <div className="vital-card">
            <h3>Respiration Rate</h3>
            <p className="value">
              {patientData.vitals.respiration} /min
            </p>
          </div>
        </div>
      </div>

      {patientData.location.lat && patientData.location.lng && (
        <div className="location-info">
          <h2>Patient Location</h2>
          <p>Latitude: {patientData.location.lat}</p>
          <p>Longitude: {patientData.location.lng}</p>
        </div>
      )}

      <div className="update-info">
        <p>Last Updated: {patientData.lastUpdated}</p>
      </div>
    </div>
  );
};

export default PatientDetail;
